import classNames from 'classnames';

const Badge =  {
  props: {
    tag: {
      type: String,
      default: "span"
    },
    color: {
      type: String,
    },
    pill: {
      type: Boolean,
      default: false
    }
  },
  computed: {
    className() {
      return classNames(
        'badge',
        this.color,
        this.pill ? 'badge-pill' : false
      );
    }
  }
};

export default Badge;
export { Badge as mdbBadge };
